import React, { useState, useEffect, useRef } from 'react';
import SinglePage from './Components/SinglePage';
import ModifyPage from './Components/ModifyPage';
import AutoTextArea from './Components/AutoTextArea';
import FileUploader from './Components/FileUploader';
import 'react-pdf/dist/Page/AnnotationLayer.css';
import 'react-pdf/dist/Page/TextLayer.css';
import { PDFDocument, PageSizes, rgb } from 'pdf-lib';
import PDFTemplate from './Components/PDFTemplate';
import DropdownButton from './Components/DropdownButton';

export default function App ()
{
  const [ pdfFile, setPdfFile ] = useState( null );
  const [ result, setResult ] = useState( [] );
  const [ pageNumber, setPageNumber ] = useState( 1 );
  const [ redoStack, setRedoStack ] = useState( [] );
  const [ flag, setFlag ] = useState( "" );
  const [ bounds, setBounds ] = useState( {} );
  const [ isText, setIsText ] = useState( false );
  const [ buttonType, setButtonType ] = useState( "" );
  const tempRef = useRef( null );
  const [ fileUploaded, setFileUploaded ] = useState( false );
  const [ uploadedImage, setUploadedImage ] = useState( null );
  const [ lastClickLocation, setLastClickLocation ] = useState( { x: 0, y: 0 } );

  useEffect( () =>
  {
    if ( isText )
    {
      setIsText( false );
    }
  }, [ result ] );

  // Function to handle file upload
  const handleFileUpload = ( files ) =>
  {
    const file = files[ 0 ];
    setPdfFile( file );
    setFileUploaded( true );
  };

  const addImage = () =>
  {
    setIsText( false ); // Ensure text mode is turned off
    document.getElementById( "drawArea" ).addEventListener( "click", handleImageClick );
  };

  // Event listener to handle image click and capture mouse coordinates
  const handleImageClick = ( e ) =>
  {
    const mouseX = e.clientX + document.documentElement.scrollLeft || document.body.scrollLeft;
    const mouseY = e.clientY + document.documentElement.scrollTop || document.body.scrollTop;
    handleImageUpload( mouseX, mouseY );
  };

  // Function to handle image upload with provided mouse coordinates
  const handleImageUpload = ( mouseX, mouseY ) =>
  {
    document.getElementById( "imageInput" ).click();
    const fileInput = document.getElementById( "imageInput" );
    fileInput.addEventListener( "change", ( e ) =>
    {
      const file = e.target.files[ 0 ];
      if ( file )
      {
        const reader = new FileReader();
        reader.onload = ( event ) =>
        {
          setResult( [
            ...result,
            { id: generateKey( mouseX ), x: mouseX, y: mouseY - 10, image: event.target.result, page: pageNumber, type: "image" }, // Include page number
          ] );
        };
        reader.readAsDataURL( file );
      }
    } );
  };

  // Keep track of current page number
  const pageChange = ( num ) =>
  {
    setPageNumber( num );
  };

  // Function to add text in PDF
  const addText = () =>
  {
    // Flag to change cursor if text
    setIsText( true );
    document.getElementById( "drawArea" ).addEventListener( "click", ( e ) =>
    {
      e.preventDefault();
      setResult( ( result ) => [
        ...result,
        { id: generateKey( e.pageX ), x: e.pageX, y: e.pageY - 10, text: "", page: pageNumber, type: "text", ref: tempRef },
      ] );
    }, { once: true } );
  };

  // Undo function for both line and text
  const undo = () =>
  {
    let temp = result.pop();
    if ( temp )
    {
      if ( temp.type === "freehand" )
      {
        // Flag for DrawArea reference
        setFlag( "undo" );
      }
      setRedoStack( ( stack ) => [ ...stack, temp ] );
      setResult( result );
    }
  };

  // Flag for DrawArea reference
  const changeFlag = () =>
  {
    setFlag( "" );
  };

  // Redo functionality
  const redo = () =>
  {
    let top = redoStack.pop();
    if ( top )
    {
      if ( top.type === "freehand" )
      {
        // Flag for DrawArea reference
        setFlag( "redo" );
      }
      setResult( ( res ) => [ ...res, top ] );
    }
  };

  const getPaths = ( el ) =>
  {
    setResult( ( res ) => [ ...res, el ] );
  };

  const getBounds = ( obj ) =>
  {
    setBounds( obj );
  };

  const generateKey = ( pre ) =>
  {
    return `${ pre }_${ new Date().getTime() }`;
  };

  const onTextChange = ( id, txt, ref ) =>
  {
    let indx = result.findIndex( ( x ) => x.id === id );
    let item = { ...result[ indx ] };
    item.text = txt;
    item.ref = ref;
    result[ indx ] = item;
    setResult( result );
  };

  const changeButtonType = ( type ) =>
  {
    setButtonType( type );
  };

  const resetButtonType = () =>
  {
    setButtonType( "" );
  };

  const insertNewPage = async (page) => {
    if (pdfFile) {
      try {
       if(page == "Title Page"){
        const existingPdfBytes = await pdfFile.arrayBuffer();
        const pdfDoc = await PDFDocument.load(existingPdfBytes);
        const newPage = pdfDoc.addPage(PageSizes.A4);

        // Add header image
        const headerImageBytes = await fetch(process.env.PUBLIC_URL + '/footer.png').then((res) => res.arrayBuffer());
        const headerImage = await pdfDoc.embedPng(headerImageBytes);
        const headerX = 10; // Adjust as needed
        const headerY = newPage.getHeight() - 100; // Adjust as needed, placed near the top
        const headerWidth = 580; // Adjust as needed
        const headerHeight = 90; // Adjust as needed
        newPage.drawImage(headerImage, {
            x: headerX,
            y: headerY,
            width: headerWidth,
            height: headerHeight,
        });
        
        // Add footer image
        const footerImageBytes = await fetch(process.env.PUBLIC_URL + '/footer.png').then((res) => res.arrayBuffer());
        const footerImage = await pdfDoc.embedPng(footerImageBytes);
        const footerX = 10; // Adjust as needed
        const footerY = 10; // Adjust as needed
        const footerWidth = 580; // Adjust as needed
        const footerHeight = 90; // Adjust as needed
        newPage.drawImage(footerImage, {
          x: footerX,
          y: footerY,
          width: footerWidth,
          height: footerHeight,
        });

        // Add border between header and footer
        const borderX = 10; // Same X coordinate as header and footer
        const borderY = footerY + footerHeight + 10; // Y coordinate just above the footer
        const borderWidth = headerWidth; // Same width as header and footer
        const borderHeight = headerY - (footerY + footerHeight + 20); // Height between header and footer
        const borderColor = rgb(0, 0, 0); // Border color (black)

        // Top border line
        newPage.drawLine({
            start: { x: borderX, y: borderY + borderHeight },
            end: { x: borderX + borderWidth, y: borderY + borderHeight },
            thickness: 1,
            color: borderColor,
        });

        // Bottom border line
        newPage.drawLine({
            start: { x: borderX, y: borderY },
            end: { x: borderX + borderWidth, y: borderY },
            thickness: 1,
            color: borderColor,
        });

        // Left border line
        newPage.drawLine({
            start: { x: borderX, y: borderY },
            end: { x: borderX, y: borderY + borderHeight },
            thickness: 1,
            color: borderColor,
        });

        // Right border line
        newPage.drawLine({
            start: { x: borderX + borderWidth, y: borderY },
            end: { x: borderX + borderWidth, y: borderY + borderHeight },
            thickness: 1,
            color: borderColor,
        });

        const newPdfBytes = await pdfDoc.save();
        setPdfFile(new Blob([newPdfBytes], { type: 'application/pdf' }));
        setPageNumber(pdfDoc.getPageCount()); // Set page number to the newly inserted page
      }
      else if (page == "Cover Page 1"){
        const existingPdfBytes = await pdfFile.arrayBuffer();
        const pdfDoc = await PDFDocument.load(existingPdfBytes);

        // Add a new page in landscape orientation
        const pageWidth = PageSizes.A4[1];
        const pageHeight = PageSizes.A4[0]; // Use reverse for landscape
        const newPage = pdfDoc.addPage([pageWidth, pageHeight]);

        const borderColor = rgb(0, 0, 0);
        const boxThickness = 1;
        const gap = 10;

        // Define the main border
        const borderX = 10;
        const borderY = 10;
        const borderWidth = pageWidth - 20;
        const borderHeight = pageHeight - 20;

        // Draw main border lines
        // newPage.drawRectangle({
        //   x: borderX,
        //   y: borderY,
        //   width: borderWidth,
        //   height: borderHeight,
        //   borderColor: borderColor,
        //   borderWidth: boxThickness,
        // });

        // Calculate split points with gaps
        const halfHeight = (borderHeight - gap) / 2;
        const smallBoxWidth = (borderWidth - 2 * gap) * 0.45;
        const largeBoxWidth = (borderWidth - 2 * gap) * 0.55;

        // Upper half boxes
        const upperY = borderY + halfHeight + gap;

        // Small box (25% width)
        newPage.drawRectangle({
          x: borderX,
          y: upperY,
          width: smallBoxWidth,
          height: halfHeight,
          borderColor: borderColor,
          borderWidth: boxThickness,
        });

        // Gap between small box and large box
        const secondBoxX = borderX + smallBoxWidth + gap;

        // Large box (75% width)
        newPage.drawRectangle({
          x: secondBoxX,
          y: upperY,
          width: largeBoxWidth,
          height: halfHeight,
          borderColor: borderColor,
          borderWidth: boxThickness,
        });

        // Lower half box (100% width)
        newPage.drawRectangle({
          x: borderX,
          y: borderY,
          width: borderWidth,
          height: halfHeight,
          borderColor: borderColor,
          borderWidth: boxThickness,
        });

        // Save the modified PDF
        const newPdfBytes = await pdfDoc.save();
        const newBlob = new Blob([newPdfBytes], { type: 'application/pdf' });
        // Assuming setPdfFile and setPageNumber are defined
        setPdfFile(newBlob);
        setPageNumber(pdfDoc.getPageCount());
      }
      else {
        const existingPdfBytes = await pdfFile.arrayBuffer();
        const pdfDoc = await PDFDocument.load(existingPdfBytes);
      
        // Add a new page in landscape orientation
        const pageWidth = PageSizes.A4[1];
        const pageHeight = PageSizes.A4[0]; // Use reverse for landscape
        const newPage = pdfDoc.addPage([pageWidth, pageHeight]);
      
        const borderColor = rgb(0, 0, 0);
        const boxThickness = 1;
        const gap = 10;
      
        // Define the main border
        const borderX = 10;
        const borderY = 10;
        const borderWidth = pageWidth - 20;
        const borderHeight = pageHeight - 20;
      
        // Calculate widths and heights
        const leftBoxWidth = (borderWidth - gap) * 0.35;
        const rightBoxWidth = (borderWidth - gap) * 0.65;
        const upperRightBoxHeight = (borderHeight - gap) * 0.5;
        const lowerRightBoxHeight = (borderHeight - gap) * 0.5;
      
        // Left box (35% width, full height)
        newPage.drawRectangle({
          x: borderX,
          y: borderY,
          width: leftBoxWidth,
          height: borderHeight,
          borderColor: borderColor,
          borderWidth: boxThickness,
        });
      
        // Right upper box (65% width, 50% height)
        const rightBoxX = borderX + leftBoxWidth + gap;
        const upperRightBoxY = borderY + lowerRightBoxHeight + gap;
        newPage.drawRectangle({
          x: rightBoxX,
          y: upperRightBoxY,
          width: rightBoxWidth,
          height: upperRightBoxHeight,
          borderColor: borderColor,
          borderWidth: boxThickness,
        });
      
        // Right lower left box (32.5% width, 50% height)
        const lowerRightBoxWidth = (rightBoxWidth - gap) * 0.5;
        const lowerRightBoxY = borderY;
        newPage.drawRectangle({
          x: rightBoxX,
          y: lowerRightBoxY,
          width: lowerRightBoxWidth,
          height: lowerRightBoxHeight,
          borderColor: borderColor,
          borderWidth: boxThickness,
        });
      
        // Right lower right box (32.5% width, 50% height)
        const lowerRightBoxX = rightBoxX + lowerRightBoxWidth + gap;
        newPage.drawRectangle({
          x: lowerRightBoxX,
          y: lowerRightBoxY,
          width: lowerRightBoxWidth,
          height: lowerRightBoxHeight,
          borderColor: borderColor,
          borderWidth: boxThickness,
        });
      
        // Save the modified PDF
        const newPdfBytes = await pdfDoc.save();
        const newBlob = new Blob([newPdfBytes], { type: 'application/pdf' });
        // Assuming setPdfFile and setPageNumber are defined
        setPdfFile(newBlob);
        setPageNumber(pdfDoc.getPageCount());
      }
      } 
      catch (error) {
        console.error('Error inserting new page:', error);
      }
    }
  };  

  const buildingInfo = {
    'Name': 'Test User',
    'Address': '10 Rockefeller Plz Manhattan, NY 10020',
    'Year Built': '1939',
    'Cross Street': '5th Av',
    'Number of Buildings': '1',
    'Number of Floors': '17',
    'Total Number of Units': '0 MDUs & 16 MTUs',
    'Management Company': 'Lucy',
    'Owner / Property Manager Contact': '(718) 213-9510',
    'Site Contact': 'Commercial',
    'Owner Type': 'Concrete',
    'Exterior Material': 'Sheetrock',
    'P.O.E. Type': 'Feed from MH 157',
  };
  const testData = {
    buildingInformation: buildingInfo,
    textData: {
      title: 'Building Information',
      subtitle: 'An Epic Tale of Woe'
    },
    // images: ['https://pdf-lib.js.org/assets/cat_riding_unicorn.jpg','https://pdf-lib.js.org/assets/cat_riding_unicorn.jpg'
    // ]
    images: [
      {
        name: 'image1',
        data: "",
      },
      {
        name: 'image2',
        data: "",
      },
    ],
  };

  return (
    <div className="App">
      { pdfFile ? (
        <>
          { result.map( ( res ) =>
          {
            if ( res.type === "text" )
            {
              let isShowing = "hidden";
              if ( res.page === pageNumber )
              {
                isShowing = "visible";
              }
              return (
                <AutoTextArea
                  key={ res.id }
                  unique_key={ res.id }
                  val={ res.text }
                  onTextChange={ onTextChange }
                  style={ { visibility: isShowing, color: "red", fontWeight: "normal", fontSize: 16, zIndex: 20, position: "absolute", left: res.x + 'px', top: res.y + 'px' } }
                ></AutoTextArea>
              );
            } else
            {
              return null;
            }
          } ) }

          <h1 style={ { color: "#3f51b5" } }>REACT PDF EDITOR</h1>

          <hr />

          <div className="navbar">
            <button onClick={ undo } style={ { marginTop: "1%", marginBottom: "1%" } }><i style={ { fontSize: 25 } } className="fa fa-fw fa-undo"></i></button>
            <button onClick={ redo } style={ { marginTop: "1%", marginBottom: "1%" } }><i style={ { fontSize: 25 } } className="fa fa-repeat"></i></button>
            <button onClick={ addText } style={ { marginTop: "1%", marginBottom: "1%" } }><i style={ { fontSize: 25 } } className="fa fa-text-width"></i></button>
            {/* <button onClick={() => changeButtonType("draw")} style={{ marginTop: "1%", marginBottom: "1%" }}><i style={{ fontSize: 25 }} className="fa fa-fw fa-pencil"></i></button> */ }
            <button onClick={ () => changeButtonType( "download" ) } style={ { marginTop: "1%", marginBottom: "1%" } }><i style={ { fontSize: 25 } } className="fa fa-fw fa-download"></i></button>
            {/* <button onClick={ insertNewPage } style={ { marginTop: "1%", marginBottom: "1%" } }><i style={ { fontSize: 25 } } className="fa fa-plus"></i></button> */}
            <button onClick={ addImage } style={ { marginTop: "1%", marginBottom: "1%" } }><i style={ { fontSize: 25 } } className="fa fa-picture-o"></i></button>
            <DropdownButton insertNewPage={insertNewPage} />
          </div>
          <input id="imageInput" type="file" accept="image/*" style={ { display: "none" } } onChange={ handleImageUpload } />
          <SinglePage resetButtonType={ resetButtonType } buttonType={ buttonType } cursor={ isText ? "text" : "default" } pdf={ pdfFile } pageChange={ pageChange } getPaths={ getPaths } flag={ flag } getBounds={ getBounds } changeFlag={ changeFlag } images={ result } />
          <ModifyPage resetButtonType={ resetButtonType } buttonType={ buttonType } pdf={ pdfFile } result={ result } bounds={ bounds } />
          <hr></hr>
        </>
      ) : (
        <>
        <div style={{ textAlign: 'center', paddingTop: '20px' }}>
          <h1 style={{ color: '#3f51b5', marginBottom: '100px' }}>REACT PDF EDITOR</h1>
          <p style={{fontWeight: "bold", fontSize: "30px"}}>Create a General PDF Template</p>
          <div style={{ display: 'flex', justifyContent: 'center', marginBottom: '40px', marginTop: '20px' }}>
            <PDFTemplate data={{ buildingInformation: testData.buildingInformation, images: testData.images, text: testData.textData }} />
          </div>
        </div>
        <p style={{fontWeight: "bold", fontSize: "40px"}}>OR</p>
        {!fileUploaded && <FileUploader onFileUpload={handleFileUpload} />}
        </>
      ) }
    </div>
  );
}
